import { initAuth0 } from '@auth0/nextjs-auth0'

export default initAuth0({
    clientId: 'ALk3BS2R8t3j97vm7qW9kROhmH1s2s2V',
    clientSecret: 'T2CTUmjhj5Jkua0p90HlorMr4AaYbuTGxiYyf3yYfrB-QeAdRH2eTp5l8V4QJu09',
    scope: 'openid profile',
    domain: 'natancf.auth0.com',
    redirectUri: 'http://localhost:3000/api/callback',
    postLogoutRedirectUri: 'http://localhost:3000',
    session: {
        cookieSecret: 'afdecfdgfbdactdachdadcdascgabygsabcd',
        cookieLifetime: 3600
    }
})
